import Axios from "axios";
import { DOMAIN } from "../../services/domainUrl";
import { MESSAGE_DATA_ERROR, MESSAGE_STATUS_CODE } from "../constants/messageSnackbar.constant";
import { ERR_NOTIFI_SIGNUP, INFOR_SIGNIN, SUCCESS_NOTIFI_SIGNUP } from "../constants/signup.constant";

export const postSignUp_Action = (data) => {
  return async (dispatch) => {
    try {
      const res = await Axios({
        method: "POST",
        url: `${DOMAIN}QuanLyNguoiDung/DangKy`,
        data,
      })
      dispatch({
        type: INFOR_SIGNIN,
        payload: res.data,
      })
      console.log(res.data);
      dispatch({
        type: SUCCESS_NOTIFI_SIGNUP,
        payload: res.status
      })
    } catch (error) {
      dispatch({
        type: ERR_NOTIFI_SIGNUP,
        payload: error.response.data
      })
      dispatch({
        type: MESSAGE_STATUS_CODE,// show message error
        payload: error.response.status
    })
    dispatch({
        type: MESSAGE_DATA_ERROR,// show message error
        payload: error.response.data
    })
    }
  }
};
